import { Card } from "react-bootstrap";

const Product = ({ product }) => {
  return (
    <Card className="my-3 py-3 rounded">
      {product.name}
      <a href={`${product._id}`}>
        <Card.Img src={product.image} />
      </a>
      <Card.Body>
        <a href={`${product._id}`}>
          <Card.Title as="div">
            <strong>{product.name}</strong>
          </Card.Title>
        </a>
      </Card.Body>
    </Card>
  );
};

export default Product;
